import { useSelector } from "react-redux";
import { useRouter } from "next/router";
import Link from "next/link";
export default function Post() {
  const router = useRouter();
  const { postId } = router.query;
  return (
    <>
      <h1>First Post</h1>
      <h2>
        <Link href="/">
          <a>Back to home</a>
        </Link>
        <p>{postId}</p>
      </h2>
    </>
  );
}
